import * as React from 'react'
import PropTypes from 'prop-types'



class Artista extends React.Component{
	render(){
		return (
			({name,image,id}) => (
				<div className="artista" >
					<span>{name}</span>
					<img src={image} alt={name}/>
				</div>
			)
		) 
	}
}

export default Artista
